import { useContext } from 'react';
import moment from 'moment';

import { useTranslation } from 'react-i18next';

import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  Typography,
  Icon,
  ListItem,
  List,
  ListItemAvatar,
  Avatar,
  ListItemText,
} from '@mui/material';
import { makeStyles } from '@mui/styles';
import TravelContext from '../travel-context/TravelContext';

const iconType = {
  '-1': 'warning',
  '-2': 'warning',
  0: 'check_circle',
};

const useStyles = makeStyles({});

export default function DialogStatistics(props) {
  const { open, handleClose, record } = props;
  const { dicoin } = useContext(TravelContext);
  const { t } = useTranslation('travelsPage');
  const classes = useStyles();
  function msToSeconds(duration) {
    const seconds = Math.ceil((duration / 1000) % 60);
    return `${seconds}`;
  }
  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="alert-dialog-title"
      aria-describedby="alert-dialog-description"
    >
      <DialogTitle id="alert-dialog-title">{t('TRAVEL_DIALOG_RECORD_DETAIL_TITLE')}</DialogTitle>
      <DialogContent dividers>
        {record.type === 'RECORD' && (
          <div className="flex items-start">
            <Icon className="mr-10">sync_alt</Icon>
            <div>
              <Typography>
                {t('TRAVEL_DIALOG_RECORD_DETAIL_STATE')}: <b>{t(record.state)}</b>
              </Typography>
              <Typography>
                {t('TRAVEL_DIALOG_RECORD_DETAIL_LATENCY')}:{' '}
                <b>∑ {Math.ceil(dicoin.getRecordAttemptsLatencySum(record))} milisegundos</b>
              </Typography>
              <Typography>
                {t('TRAVEL_DIALOG_RECORD_DETAIL_ATTEMPTS')}: <b>{record.stats.retryAttempt}</b>
              </Typography>
              {record.stats && record.stats.sentTimestamp && (
                <Typography>
                  {t('TRAVEL_DIALOG_RECORD_DETAIL_TIME_ON_WAITING')}:{' '}
                  <b>{msToSeconds(record.stats.sentTimestamp - record.timestamp)} seg</b>
                </Typography>
              )}
            </div>
          </div>
        )}
        {record.type === 'NOTE' && (
          <div className="flex items-start">
            <div>
              <Typography>
                {t('TRAVEL_DIALOG_RECORD_DETAIL_TIMESTAMP')}:{' '}
                <b>{moment(record.timestamp).format('DD/MM/YYYY HH:mm:ss')}</b>
              </Typography>
              <Typography>
                {t('TRAVEL_DIALOG_RECORD_DETAIL_NOTE')}: <b>{t(record.note)}</b>
              </Typography>
            </div>
          </div>
        )}
        <div className="mt-10">
          {record.stats && record.stats.attempts.length > 0 && (
            <Typography># {t('TRAVEL_DIALOG_RECORD_DETAIL_STATUS_DESCRIPTION')}</Typography>
          )}
          <div>
            <ul className="list-disc pl-14">
              {((record.stats || {}).attempts || []).map((attempt, index) => (
                <li>
                  <Typography className="text-xs">
                    <Icon className="mr-5 text-xs">{iconType[attempt.code]}</Icon> {attempt.code}{' '}
                    {attempt.message}
                  </Typography>
                </li>
              ))}
            </ul>
          </div>
        </div>

        <List>
          <ListItem
            button
            key="goToMaps"
            onClick={() => {
              console.log(record)
              const geoLocation = record.tripTempState.geolocationPosition;
              window.open(
                `https://www.google.com/maps/search/?api=1&query=${geoLocation.coords.latitude},${geoLocation.coords.longitude}`,
                '_blank'
              );
            }}
          >
            <ListItemAvatar>
              <Avatar>
                <Icon>maps</Icon>
              </Avatar>
            </ListItemAvatar>
            <ListItemText primary="Ir a Maps" />
          </ListItem>
        </List>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} variant="contained" color="error">
          Cerrar
        </Button>
      </DialogActions>
    </Dialog>
  );
}
